 return formattedDate.toDateString();
}  

const CoinPage = () => {
  const {state} = useLocation();
const {symbol,high,low,volume,quoteVolume,percentChange,updatedAt} = state;

console.log("symbol"+symbol);


  return (
    <div>
       <div className="coin">
         <h1> Name: {symbol}</h1>
         <h3> Highest Rate: {high}</h3>
